import React, { useState } from "react";
import { motion } from "framer-motion";
import Swal from "sweetalert2"; // Importer SweetAlert2
import "sweetalert2/dist/sweetalert2.min.css";
import Cover from "./cover";
import axios from "axios";

const App = () => {
  // √âtat pour stocker les valeurs du formulaire
  const [state, setState] = useState({
    age: 40,
    hypertension: 0,
    heart_disease: 0,
    avg_glucose_level: 83.94,
    bmi: 28.89,
  });
  const [error, setError] = useState(null);

  const handlePredict = async () => {
    try {
      const payload = {
        age: state.age,
        hypertension: state.hypertension,
        heart_disease: state.heart_disease,
        avg_glucose_level: state.avg_glucose_level,
        bmi: state.bmi,
      };
  
      const response = await axios.post(
        "http://localhost:5000/predict",
        JSON.stringify(payload),
        {
          headers: {
            "Content-Type": "application/json",
          },
        }
      );
  
      const { stroke, recommendations } = response.data;
  
      // üî• Message diff√©rent selon si stroke = 1 ou non
      Swal.fire({
        title: stroke ? "Risque √©lev√© de stroke" : "Risque faible",
        text: recommendations.join("\n"), // Afficher toutes les recommandations
        icon: stroke ? "warning" : "info",
        confirmButtonText: "OK",
      });
  
    } catch (error) {
      console.error("Erreur lors de la pr√©diction :", error);
      setError("Erreur lors de la pr√©diction");
  
      Swal.fire({
        title: "Erreur",
        text: "Une erreur est survenue lors de la pr√©diction",
        icon: "error",
        confirmButtonText: "OK",
      });
    }
  };
  

  return (
    <div className="container mx-auto p-4 flex flex-col justify-center items-center text-white h-screen">
      <Cover />
      <h1 className="text-4xl font-bold mb-3 text-center">
        Pr√©diction du risque d'AVC
      </h1>
      <p className="text-sm md:text-lg font-normal md:font-medium mb-8 text-center">
        Entrez les informations du patient pour √©valuer son risque d'AVC.
      </p>

      {/* Formulaire */}
      <div className="space-y-4 w-full max-w-md">
        <div>
          <label className="block mb-2 text-sm font-medium text-white">
            √Çge :
          </label>
          <input
            type="number"
            value={state.age}
            onChange={(e) => setState({ ...state, age: e.target.value })}
            className="w-full text-black px-2 py-1 rounded border"
          />
        </div>

        <div>
          <label className="block mb-2 text-sm font-medium text-white">
            Hypertension (0 = Non, 1 = Oui) :
          </label>
          <input
            type="number"
            value={state.hypertension}
            onChange={(e) => setState({ ...state, hypertension: e.target.value })}
            className="w-full text-black px-2 py-1 rounded border"
          />
        </div>

        <div>
          <label className="block mb-2 text-sm font-medium text-white">
            Maladie cardiaque (0 = Non, 1 = Oui) :
          </label>
          <input
            type="number"
            value={state.heart_disease}
            onChange={(e) => setState({ ...state, heart_disease: e.target.value })}
            className="w-full text-black px-2 py-1 rounded border"
          />
        </div>

        <div>
          <label className="block mb-2 text-sm font-medium text-white">
            Niveau de glucose moyen :
          </label>
          <input
            type="number"
            value={state.avg_glucose_level}
            onChange={(e) => setState({ ...state, avg_glucose_level: e.target.value })}
            className="w-full text-black px-2 py-1 rounded border"
          />
        </div>

        <div>
          <label className="block mb-2 text-sm font-medium text-white">
            IMC (Indice de Masse Corporelle) :
          </label>
          <input
            type="number"
            value={state.bmi}
            onChange={(e) => setState({ ...state, bmi: e.target.value })}
            className="w-full text-black px-2 py-1 rounded border"
          />
        </div>
      </div>

      {/* Bouton de pr√©diction */}
      <motion.button
        whileHover={{ scale: 1.06 }}
        whileTap={{ scale: 0.95 }}
        onClick={handlePredict}
        className="bg-blue-500 text-white px-4 py-2 rounded mt-6 text-base"
      >
        √âvaluer le risque d'AVC
      </motion.button>
    </div>
  );
};

export default App;
